import React from "react";

import { StatusBar } from "expo-status-bar";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import AuthPage from "./src/routes/AuthPage";
import FlashCard from "./src/routes/Flashcard";
import ListFlashCards from "./src/routes/ListFlasCards";

const Stack = createNativeStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Screen name={"/"} component={AuthPage} />
      <Stack.Screen name={"/mes-fiches"} component={ListFlashCards} />
      <Stack.Screen name={"/une-fiche"} component={FlashCard} />
    </NavigationContainer>
  );
}
